const Display = (props) => {
  return (
    <div>
      <span>
        {props.time.hr <= 9 ? props.time.min : "0" + props.time.hr}:
      </span>
      <span>
        {props.time.min <= 60 ? props.time.min : "0" + props.time.min}:
      </span>

      <span>
        {props.time.sec <= 9 ? props.time.sec : "0" + props.time.sec}:
      </span>

      <span>
        {props.time.milisec <= 9
          ? props.time.milisec
          : "0" + props.time.milisec}
      </span>
    </div>
  );
};

export default Display;
